import axios from "axios";

const Validate = async (email, password) => {
  console.log(email);
  const response = await axios.post(
    "http://localhost:8081/validationForLogin",
    { email, password }
  );
  if (response.status === 200) {
    alert("User Founded");
  } else {
    alert("User Not Founded");
  }
};

export default Validate;
